const subarraysDivByK = (A, K) => {
    let cnt = 0;
    for (let i = 0; i < A.length; i++) {
        for (let j = i + 1; j <= A.length; j++) {
            let subarr = A.slice(i, j);
            if (sum(subarr) % K == 0) {
                cnt++;
            }
        }
    }
    return cnt;
};

const sum = (arr) => {
    return arr.reduce((acc, current) => acc + current);
};

